import React from "react";
import "./home.css";

import "./Styles.css";
function Home() {
  return (
    <div className="centered">
      <div className="homeContainer">
        <div className="homeGreets"></div>
        <div className="homeBooking">
          <h2>Book a table</h2>
        </div>
      </div>
    </div>
  );
}

export default Home;
